function changeElement(element) {
    var elementDiv = document.getElementById('solar');
    var elementName = document.getElementById('elementName');
  
  switch(element) {
        case 'earth':
            elementDiv.style.backgroundImage = "url('https://encrypted-tbn3.google.com/images?q=tbn:ANd9GcTQqoB4xBnIkmUg5pxDyYW2h0Q1pRTsbQBOfhg-E-y4iLFicsyi')";
            elementName.innerText = "Earth";
            break;
        case 'moon':
          elementDiv.style.backgroundImage = "url('data:image/jpeg;base64,')"; // Replace the URL with the actual image URL for the moon
          elementName.innerText = "Moon";
          break;
        case 'mercury':
            elementDiv.style.backgroundImage = "url('https://www.washingtonpost.com/blogs/capital-weather-gang/files/2016/05/transit-detailed-sun.jpg')"; // Replace the URL with the actual image URL for the sun
            elementName.innerText = "Mercury";
            break;
        case 'venus':
            elementDiv.style.backgroundImage = "url('https://i.pinimg.com/originals/41/0a/61/410a6111b4fa6fa0c0d55b46b78fc083.jpg')" // Replace the URL with the actual image URL for the sun
            elementName.innerText = "Venus";
            break;
        case 'mars':
            elementDiv.style.backgroundImage = "url('data:image/jpeg;base64,')"// Replace the URL with the actual image URL for the sun
            elementName.innerText = "Mars";
            break;
        case 'jupiter':
            elementDiv.style.backgroundImage = "url('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS_BbmWwDnfJYrH5n5OF2_T-xuViS1rV4PFuQ&s')" // Replace the URL with the actual image URL for the sun
            elementName.innerText = "Jupiter";
            break;
        case 'saturn':
            elementDiv.style.backgroundImage = "url('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRgsajTRX-fVwfVJwIc91u2t7d5BMPpvLIHlA&s')"// Replace the URL with the actual image URL for the sun
            elementName.innerText = "Saturn";
            break;
        case 'uranus':
            elementDiv.style.backgroundImage = "url('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRUOW3tdlzYNwFeFP2aHuiqaiVWCKU544qr4A&s')" // Replace the URL with the actual image URL for the sun
            elementName.innerText = "Uranus";
            break;
        case 'neptune':
            elementDiv.style.backgroundImage = "url('data:image/jpeg;base64,')" // Replace the URL with the actual image URL for the sun
            elementName.innerText = "Neptune";
            break;
          default:
            break;
  }
}
